    false,nt"url": null,nt"notes": "This data set contains precipitation data
    originally recorded in log books at 65 coastal and island meteorological stations,
    and later digitized at the Arctic and Antarctic Research Institute (AARI), St. Petersburg,
    Russia, under the direction of Vladimir Radionov. Records from most stations begin
    in 1940. Instrumentation was generally a rain gauge with Nipher shield until the
    early 1950s (for most stations), when the Tretyakov precipitation gauge replaced
    earlier instrumentation.  Data have not been adjusted for gauge type or wind bias.
    Observers corrected the data from 1967-1990 for wetting loss as they recorded the
    station data.",nt"license_title": "License Not Specified",nt"extras":
